eval("// Module\nvar code = \"<template>\\r\\n    <h3>Calls for Participation</h3>\\r\\n    <span><a style=\\\"color:blue;font-weight:bold;\\\" href=\\\"/uploadedFiles/Paper_Submission_Template_2021.docx\\\">Paper Submission Template</a></span>\\r\\n    <p>The SAP North America Academic Community (SAPNAAC) is seeking proposals for presentations on a variety of topics\\r\\n        exploring new technologies and issues in enterprise systems from multiple perspectives including fundamental\\r\\n        research, practice-oriented cases, emerging research, and teaching enterprise systems in higher education. The\\r\\n        conference is organized by members of the SAP University Alliances in North America with the purpose to advance\\r\\n        knowledge sharing, collaboration, communication, and community-building among like-minded faculty, graduate\\r\\n        students and industry partners.</p>\\r\\n    <p>In past years, the conference was associated with Train-the-Trainer SAP UA workshops. This yearâ€™s conference will\\r\\n        be held online September 11-12, 2021. We will also coordinate joint events with colleagues in the SAP Academic\\r\\n        Board DACH in Europe for new opportunities to foster a growing global network focused on innovation in research,\\r\\n        teaching and practice in enterprise systems.</p>\\r\\n    <p>Paper submissions should follow the template and be submitted to the most suitable of the 5 research tracks\\r\\n        available. All research papers will be double-blind peer-reviewed, and they will be shared in the conference\\r\\n        proceedings after being presented. Additionally, each track will host a best paper award to recognize the top\\r\\n        contributors. Note that all papers are to be submitted as an extended abstract no later than July 9, 2021.\\r\\n        Authors will receive notification of acceptance by August 9, 2021. They will be expected to have camera-ready\\r\\n        final submissions ready for September 1, 2021.</p>\\r\\n    <p>In addition to the research paper tracks, as track 6, we are hosting Teaching, Research, Education, and Diversity\\r\\n        (TRED) Talks, which will accept 1-page proposals for shorter presentations until August 15. Submissions to the\\r\\n        TRED Talks will be editorially reviewed, and published in the proceedings as 1-page abstracts.</p>\\r\\n\\r\\n    <div class=\\\"row\\\" style=\\\"margin-top:30px;\\\">\\r\\n        <h4 class=\\\"col-12\\\" style=\\\"margin-top:10px;border-bottom-style: solid;border-width:1px;\\\">Track 1: Emerging\\r\\n            Technology and Innovations </h4>\\r\\n        <h5>Chair: Vishal Shah </h5>\\r\\n            <a href=\\\"mailto:shah3v@cmich.edu\\\">\\r\\n                shah3v@cmich.edu\\r\\n            </a>\\r\\n        </br>\\r\\n            Submission type: 2-3 pages extended abstract\\r\\n        </h5>\\r\\n        <div style=\\\"margin-top:10px;\\\">\\r\\n            <p>The research committee of SAPNAAC is seeking paper presentations on emerging technology, including\\r\\n                Blockchain, Internet of Things (IoT), and Artificial Intelligence (AI) systems. Distributed Ledger\\r\\n                Technologies (DLT) and blockchain (the technology behind Bitcoin) are currently disrupting multiple\\r\\n                industries, including the financial sector. Financial tech has already seen applications of blockchain\\r\\n                and DLT in high-frequency and algorithmic trading, digital securities, peer-to-peer lending, and\\r\\n                cross-boundary payment systems, for example.</p>\\r\\n            <p>IoT allows devices to send data to private blockchain networks. Such data is then used to create\\r\\n                tamper-resistant records of shared transactions. By leveraging these new protocols, enterprises can\\r\\n                enable secure, trustless messaging between devices in an IoT network. AI systems often use the trove of\\r\\n                data generated by IoT devices to predict and optimize various business processes. AI has found\\r\\n                application in various areas, from learning optimization, driverless cars, healthcare to drones. Despite\\r\\n                the proliferation of AI systems, most problems are often solved through human beings and computers\\r\\n                working cooperatively. Thus, Intelligence Augmentation (IA) is also equally important. Further, Robotic\\r\\n                Process Automation (RPA) via tools such a UIPath. Celonis has also risen to prominence to discover and\\r\\n                address bottlenecks in the business processes and the supply chains. This track invites researchers to\\r\\n                submit work in the above areas. Papers that span or integrate blockchain, IoT, RPA, and AI systems or\\r\\n                address them individually are encouraged. We also encourage papers that address these emerging areas in\\r\\n                the context of an enterprise system. Topics of interest include but are not limited to:</p>\\r\\n\\r\\n            <ul style=\\\"margin-top:10px;\\\">\\r\\n                <li>Al biases in prediction</li>\\r\\n                <li>Role of ethics in AI</li>\\r\\n                <li>Human and machine Augmentation</li>\\r\\n                <li>Enterprise-wide AI/IA integration models</li>\\r\\n                <li>AI applications in logistics, supply chain, workplace communication, HR</li>\\r\\n                <li>Blockchain and distributed ledger technology in enterprises </li>\\r\\n                <li>Fintech business models and analytics</li>\\r\\n                <li>Cryptocurrencies and digital money/ Initial Coin Offering (ICO)/ Securitized Token Offering (STO)\\r\\n                </li>\\r\\n                <li>Blockchain-driven social innovation </li>\\r\\n                <li>Data governance issues related to blockchain</li>\\r\\n                <li>Internet of Things applications of blockchain </li>\\r\\n                <li>IoT security</li>\\r\\n                <li>Blockchain and supply-chain visibility</li>\\r\\n            </ul>\\r\\n        </div>\\r\\n        <div class=\\\"row\\\" style=\\\"margin-top:30px;\\\">\\r\\n            <h4 class=\\\"col-12\\\" style=\\\"margin-top:10px;border-bottom-style: solid;border-width:1px;\\\">Track 2: SAP use in\\r\\n                the Academic Sector</h4>\\r\\n            <h5>Chair: Jan E. Christopher</h5>\\r\\n            <a href=\\\"mailto:jchristopher@desu.edu\\\">\\r\\n                jchristopher@desu.edu\\r\\n            </a>\\r\\n        </br> Submission type: 1-3 pages extended abstract\\r\\n            </h5>\\r\\n            <div style=\\\"margin-top:10px;\\\">\\r\\n                <p>The research committee of SAPNAAC is seeking paper presentations in the areas of SAP Products, such\\r\\n                    as Ariba, Concur, Fiori, Qualtrics, SuccessFactors, used in the academic sector. The committee\\r\\n                    encourages the submission of action research papers that illustrate challenges and lessons learned,\\r\\n                    and demonstrate the value of SAP implementation for educational institutions in terms of operational\\r\\n                    savings, financial improvement, customer/user experience, security and compliance, and the increased\\r\\n                    equity and inclusion of non-represented groups.</p>\\r\\n                <p>Examples of potential topics include: Challenges in rolling out new functionality; data accuracy and\\r\\n                    accessibility; driving down costs through technology use; streamlining financial operations;\\r\\n                    innovation sustainability, and intelligent technologies. Topics specific to SAP utilization in the\\r\\n                    Academic Sector include: Cloud technologies and Office 365 integration; Compensation Management,\\r\\n                    Onboarding, and Terminations; Contract Management; Data Governance, the Internet of Things,\\r\\n                    Artificial Intelligence, and Machine Learning; Grants Management and Sponsored Research\\r\\n                    Self-Service; Managing electronic employee time sheets; Managing student applications; Purchasing,\\r\\n                    online payments, and non-P.O. invoicing; SAP Payroll; SAP for inventory/warehouse management\\r\\n                    systems; SAP Process Integration; SAP S/4HANA implementation; SAP user adoption; SAP Products to\\r\\n                    Manage High Volume Transactions; Student Retention; and Travel Management. Other topics of general\\r\\n                    interest include: Information security and records management; Mobile Applications; Cloud Services;\\r\\n                    and Social Collaboration Services. </p>\\r\\n            </div>\\r\\n        </div>\\r\\n        <div class=\\\"row\\\" style=\\\"margin-top:30px;\\\">\\r\\n            <h4 class=\\\"col-12\\\" style=\\\"margin-top:10px;border-bottom-style: solid;border-width:1px;\\\">Track 4: Pedagogical\\r\\n                research</h4>\\r\\n            <h5>Chair: Gene Shan</h5>\\r\\n            <a href=\\\"mailto:shan@uhcl.edu\\\">\\r\\n            shan@uhcl.edu\\r\\n            </a></br>\\r\\n                Submission type: 1-2 pages extended abstract\\r\\n            </h5>\\r\\n            <div style=\\\"margin-top:10px;\\\">\\r\\n                <p>The research committee of SAPNAAC is seeking paper presentations in the areas of pedagogical research\\r\\n                    focusing on SAP Products, such as Predictive Analytics, Analytics Cloud, S/4 HANA, ERP, Fiori,\\r\\n                    Qualtrics, SAP Enterprise Blockchain, Human Resource Management, Interaction with Low-Code\\r\\n                    Application Development, Internet of Things (IoT), Business ByDesign, and others. With the advent of\\r\\n                    emerging technologies such as blockchain, in-memory and cloud computing, data science, social\\r\\n                    sentiment analysis, Artificial Intelligence, and the Internet of Things, both enterprise systems\\r\\n                    practice and education are rapidly evolving.</p>\\r\\n                <p>Papers focusing on business education related to enterprise systems, pedagogy, and curriculum\\r\\n                    development and implementation including but not limited to innovative teaching approaches, student\\r\\n                    engagement, serious games, directed student learning such as internship or co-op programs,\\r\\n                    challenges and opportunities in online teaching and engagement, active learning, learning analytics,\\r\\n                    educational data mining, course materials, SAP-embedded curriculum design & implementation,\\r\\n                    extra-curriculum activities, outcome assessment, case studies, capstone projects and faculty\\r\\n                    learning community development are invited. Work-in-progress is welcome. Preferences will be given\\r\\n                    to SAP-related content.</p>\\r\\n            </div>\\r\\n        </div>\\r\\n        <div class=\\\"row\\\" style=\\\"margin-top:30px;\\\">\\r\\n            <h4 class=\\\"col-12\\\" style=\\\"margin-top:10px;border-bottom-style: solid;border-width:1px;\\\">Track 5: Future of\\r\\n                Corporate Innovation and Design Thinking</h4>\\r\\n            <h5>Chair: Victor Taratukhin</h5>\\r\\n            <a href=\\\"mailto:victor.taratukhin@sap.com\\\">\\r\\n                victor.taratukhin@sap.com\\r\\n            </a></br>\\r\\n                Submission type: 2-3 pages extended abstract\\r\\n            </h5>\\r\\n            <div style=\\\"margin-top:10px;\\\">\\r\\n                <p>The research committee of SAPNAAC is seeking paper presentations in the area of Design Thinking and\\r\\n                    Methods of Corporate Innovation. Presentations submitted in this track focus on the practice and\\r\\n                    theory of innovation development and ideation as opposed to the resulting solutions. Topics of\\r\\n                    interest include but are not limited to:</p>\\r\\n                <ul>\\r\\n                    <li>New Frontiers in Open Innovation</li>\\r\\n                    <li>Human-Centered Approach to Innovation</li>\\r\\n                    <li>Design-driven methods and tools. </li>\\r\\n                    <li>Stanford Design Method, Design Thinking, Advanced Design Thinking</li>\\r\\n                    <li>Design Thinking for Engineering and Management Education</li>\\r\\n                    <li>Innovation and Team collaboration in post-COVID world. </li>\\r\\n                    <li>Gamification and Virtual Reality applications for Innovation</li>\\r\\n                    <li>Industry applications of Design thinking</li>\\r\\n                </ul>\\r\\n            </div>\\r\\n        </div>\\r\\n        <div class=\\\"row\\\" style=\\\"margin-top:30px;\\\">\\r\\n            <h4 class=\\\"col-12\\\" style=\\\"margin-top:10px;border-bottom-style: solid;border-width:1px;\\\">Track 6: Teaching,\\r\\n                Research, Education and Diversity (TRED) Talks </h4>\\r\\n            <h5>Chair: Michael Bliemel </h5>\\r\\n            <a href=\\\"mailto:mb@ontariotechu.ca\\\">\\r\\n                mb@ontariotechu.ca\\r\\n            </a></br>\\r\\n                Submission type: 1 page extended abstract</br>\\r\\n                Note: this track has a deadline of August 15th\\r\\n\\r\\n            </h5>\\r\\n            <div style=\\\"margin-top:10px;\\\">\\r\\n                <p>We are introducing a new way to participate at the SAP UA conference with TRED Talks, inspired by the\\r\\n                    TREO talks at ICIS and TED talks. You will submit a one-page abstract that will be editorially\\r\\n                    reviewed for fit with the conference theme. Once accepted you will have a 5-10 minute presentation\\r\\n                    that will need to be submitted the week before the talk. The aim is to build a rapid-fire program of\\r\\n                    exciting and interesting ideas on promoting Teaching, Research, Education, or Diversity in the SAP\\r\\n                    University Alliances. TRED Talk submissions will be publicly shared in the conference proceedings to\\r\\n                    inspire the broader community and to find innovation partners. Preference is given to papers that\\r\\n                    include SAP-related content.</p>\\r\\n                <p>Topics that could be submitted for TRED talks include the following:</p>\\r\\n                <ul>\\r\\n                    <li>Ideas for novel teaching innovations you are looking to develop</li>\\r\\n                    <li>Research ideas that leverage SAP UA curriculum or technologies</li>\\r\\n                    <li>Novel ideas for improving education within the UA community</li>\\r\\n                    <li>Ideas to increase diversity and inclusion in academic programs and the workplace</li>\\r\\n\\r\\n                </ul>\\r\\n            </div>\\r\\n        </div>\\r\\n    </div>\\r\\n</template>\";\n// Exports\nmodule.exports = code;//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///modules/site/callForPapers2021.html\n");

